    "Waterfowl Management Handbook 13.1.1 Nutritional Values of Waterfowl Foods",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:06:21.486959",nt"name": "waterfowl-management-handbook-13-1-1-nutritional-values-of-waterfowl-foods",nt"isopen":
    false,nt"url": null,nt"notes": "Over 40 species of North American waterfowl
    use wetland habitats throughout their annual cycles. Survival, reproduction, and
    growth are dependent on the availability of foods that meet nutritional requirements
    for recurring biological events. These requirements occur among a wide variety of
    environmental conditions that also influence nutritional demands. Recent work on
    nesting waterfowl has identified the femaleu2019s general nutrient needs for egg
    laying and incubation. Far less is known about nutritional requirements for molt
    and other portions of the life cycle, particularly those during the nonbreeding
    season. Although information on specific requirements for amino acids and micronutrients
    of wild birds is meager, the available information on waterfowl requirements can
    be used to develop waterfowl management strategies. For example, nutrient content
    of foods, nutritional requirements of waterfowl, and the cues waterfowl use in locating
    and selecting foods are all kinds of information that managers need to encourage
    use of habitats by feeding waterfowl. Waterfowl nutritional needs during the annual
    cycle and the nutritional values of natural foods and crops will be discussed below.",nt"license_title":
